            // The next point on the path
            mxcad.pathLineTo(100, 400);
            // The next point on the path
            mxcad.pathLineTo(0, 400);
            // Set the path to closed
            mxcad.pathMakeClosed();
            // Generate a rectangle box with a polysemy line
